Amfizematöz değişiklikler ilaçlı tomografi sonucu. Pulmoner BT anjiyografi incelemesinde distal dalları hakkında yorum yapılamadı. Kesitler akciğer parankim penceresinde değerlendirildiğinde her iki akciğer parankiminde fokal amfizematöz değişiklikler mevcuttur. Bazallerde dependan yetki değişiklikleri mevcuttur. Solunum fonksiyon testi: 
FVCex 5.15, 5.23 (102%); 
Fev1 ** ** ** (112%); 
FEV1/IVC 79, FEV1/FVC 79, 89; 
PEF 9.57, 10.44 (109); 
MEF75 8.33, 9.27 (111); 
MEF50 5.27, 7.02 (133); 
MEF25 2.32, 2.95 (127); 
MEF25-75 4.35, 5.78 (133).
Hocam tomografi sonucu ile solunum testi. Hocam bana KOAH balon tedavisi yapılır mı? Hocam yorumlar mısınız?
